import logo from './logo.svg';
import './App.css';
import {BrowserRouter, Switch, Route} from "react-router-dom"
import Navbar from "./components/Navbar";

function App() {
  return (
    <BrowserRouter>
      <Navbar/>

      <Switch>
        <Route path="/login" component={login}/>

      </Switch>

    </BrowserRouter>
  );
}

export default App;
